import React from "react";
import "./Menu.css";

const Menu = () => {
  return (
    <div className="menu-items">
      <div>Home</div>
      <div>About</div>
      <div>Skills</div>
      <div>Education</div>
      <div>Work Experience</div>
      <div>Contact</div>
    </div>
  );
};

export default Menu;
